import React from 'react';
import Navbar from './Navbar';
import Header from './Header';
import Particles from 'react-particles-js';

// here goes alla components.
//nedeed to install partcles
const Home = () => {

    return (
        <>

            <Navbar/>
            <Header/>
            <Particles
            params={{
              particles:{
                  number:{
                      value: 45
                  }
              }

          }}

          />


        </>
    );
}

export default Home;

